import React from 'react';
import ReactDOM from 'react-dom';
import './index.module.css';
import App from './App';

import * as serviceWorker from './serviceWorker';
import Dialog from "./components/dialogs/dialog/dialog";
import Chat from "./components/dialogs/chat/chat";
let dialogsData = [
    {id:1, name:'Ivan'},
    {id:2, name:'Dima'},
    {id:3, name:'Gromik'}
];
let messagesData = [
    {id:1, message:'Hello, Ivan!!'},
    {id:2, message:'My name Kirill!!!'},
    {id:3, message:'Idi naxyi'}
];
let postData = [
    {id:1, message:'Hi Lerill',like:10},
    {id:1, message:'sdlfkkhfshlkj', like:5}
];
let dialogsElements = dialogsData.map(dialog => <Dialog name={dialog.name} id={dialog.id}/>);
let dialogsMessage = messagesData.map(message=><Chat sms={message.message}/>);
ReactDOM.render(<App posts={postData} elements={dialogsElements} message={dialogsMessage}/>, document.getElementById('root'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
